        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eA module defining the field Q of rationals and the small finite fields F2, F3, F4, F5, F7, F8, F9, F11, F13, F16, F17, F19, F23, F25.\n\u003c/p\u003e\u003cp\u003eGiven a prime power q, Fq is the type representing elements of the field (eg \u003ccode\u003eF4\u003c/code\u003e),\n fq is a list of the elements of the field, beginning 0,1,... (eg \u003ccode\u003ef4\u003c/code\u003e),\n and for prime power fields, aq is a primitive element, which generates the multiplicative group (eg \u003ccode\u003ea4\u003c/code\u003e).\n\u003c/p\u003e\u003cp\u003eThe design philosophy is that fq, the list of elements, represents the field.\n Thus, many functions elsewhere in the library expect to take fq as an argument,\n telling them which field to work over.\n\u003c/p\u003e\u003c/div\u003e",
